import "../library-view.css";
import React, { useContext, useState } from "react";
import Modal from "react-bootstrap/Modal";
import { Button } from "react-bootstrap";
import { PanelContext } from "../panels";
import Draggable from "react-draggable";

export const chartContext = React.createContext();

const Actions = (props) => {
  const [
    currentPanel,
    setCurrentPanel,
    currentIndicator,
    setCurrentIndicator,
    currentVisualization,
    setCurrentVisualization,
    indicators,
    visualizations,
  ] = useContext(PanelContext);

  const [element, setElement] = useState();

  const getElement=(i)=>{
    visualizations.map((item)=>{
        if(item.id == i) setElement(item)
    })
  }

  return (
    <>
      {currentPanel === undefined ? (
        " "
      ) : (
        <Draggable>
          <Modal
            show={props.show}
            backdrop="static"
            keyboard={true}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            dialogClassName="modal-style"
            scrollable
            centered
          >
            <Modal.Header>
              <Modal.Title>{currentPanel.title}</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <table className="table table-dark">
                <tbody>
                  <tr>
                    <td>Name</td>
                    <td>
                      <input
                        type="text"
                        placeholder="Panel Title"
                        onChange={(e) =>
                          setCurrentPanel({
                            ...currentPanel,
                            title: e.target.value,
                          })
                        }
                        name="title"
                        value={currentPanel.title}
                        required
                      />
                    </td>
                  </tr>
                  <tr>
                    <td>Description</td>
                    <td>
                      <textarea
                        type="text"
                        placeholder="Description..."
                        value={currentPanel.description}
                        onChange={(e) =>
                          setCurrentPanel({
                            ...currentPanel,
                            description: e.target.value,
                          })
                        }
                        name="description"
                        required
                      />
                    </td>
                  </tr>
                  <tr>
                    <td>Indicator</td>
                    <td>
                      <select className="formselect" name="indicator" required>
                        {indicators.map((item) => {
                          return <option value={item.id}>{item.title}</option>;
                        })}
                      </select>
                    </td>
                  </tr>
                  <tr>
                    <td>Visualization</td>
                    <td>
                      <select
                        className="formselect"
                        name="chart"
                        onChange={(e) => {
                         // setElement(e.target.value);
                          getElement(e.target.value);
                          console.log(element);
                        }}
                        required
                      >
                        {visualizations.map((item) => {
                          return <option value={item.id}>{item.title}</option>;
                        })}
                      </select>
                      <td>
                        <div className="chart_box">
                          <img alt="Chart" src="" />
                        </div>
                      </td>
                    </td>
                  </tr>
                  <tr>
                    <td></td>
                    <td>
                      <input
                        className="btn btn-primary"
                        value="Submit"
                        type="submit"
                      />
                    </td>
                  </tr>
                </tbody>
              </table>
            </Modal.Body>
            <Modal.Footer>
              <Button
                type="button"
                size="sm"
                variant="secondary"
                onClick={props.onClose}
              >
                Cancel
              </Button>
              <Button
                type="submit"
                size="sm"
                variant="secondary"
                onClick={props.onSave}
              >
                Save
              </Button>
            </Modal.Footer>
          </Modal>
        </Draggable>
      )}
    </>
  );
};
export default Actions;
